    console.log('data', data)

    const json = JSON.stringify(data)

    console.log('json', json)

    const registryLivingPlace = async (data) => {
        const res = await axios.post('http://10.0.4.5:8000/api/v1/vhe/introduction/', data)
        /* const res = await axios.post(process.env.REACT_APP_URL + 'vhe/introduction/', data) */
    }

    registryLivingPlace(data)

    return (
        <>

        </>
    )
}

